import { DefaultTheme } from "react-native-paper";

export default  theme = {
	...DefaultTheme,
	colors: {
		...DefaultTheme.colors,
		primary: "#CFECC5",
		secondary: "#7FD661",
		buttoncolor: "#80D2F1",
		error: "#f13a59",
	},
};
